import React, {Component} from "react";
import MainPageService from "./MainPageService";
import Row from "antd/es/descriptions/Row";
import Col from "antd/es/grid/col";
import Card from "antd/es/card";

class MainProjectList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            projectList: []
        }

    }
    componentDidMount() {
        MainPageService.getAllProjects().then(response => {
            this.setState({
                projectList: response.data
            });
            console.log(this.state.projectList)
        })
    }

    render() {
        return (
            <div className="site-card-wrapper">

                    {
                        this.state.projectList.map(
                            project =>
                                <tr key={project.id}>
                                    <td>{project.id}</td>
                                    <td>{project.projectName}</td>
                                    <td>{project.s3key}</td>
                                    <td>{project.createTime}</td>
                                    {/*<td><button className="btn btn-warning"*/}
                                    {/*            onClick={() => this.deleteCourseClicked(course.id)}>*/}
                                    {/*    Delete*/}
                                    {/*</button>*/}
                                    {/*</td>*/}
                                    {/*<td>*/}
                                    {/*    <button className="btn btn-success" onClick={() => this.updateCourseClicked(course.id)}>Update</button>*/}
                                    {/*</td>*/}
                                </tr>
                        )
                    }

            </div>
        )
    }

}

export default MainProjectList;
